# Calculate site probabilities under infinite sites model for a sample of two
# haplotypes from each population in a M model.
siteprobs(m, μ, a, b) = siteprobs([m, μ, a, b])

function siteprobs(xs) 
    b = _FD(xs)
    c = _HA(xs)
    d = _HB(xs)
    e = _HAB(xs)
    return [1-b-c-d-e, b, c, d, e]
end

